      world through independent coding projects. Feel free to check out my Github!
      <br />
      Having struggled with social interaction at a young age, I am passionate about leveraging
      technology to advance the human interaction model. In pursuit of this goal, I envision an
      Artificial Intelligence bot that can facilitate, and engage in, healthy human interaction."
    />
  )
}";
